import './App.css';

function App() {
  return (
    <div>
        <Router>
            <Routes>
                <Route path="/" element={
                    <Weather
                    />}/>
            </Routes>
        </Router>
    </div>
  );
}

function Nav() {
    return (
        <ul id='nav'>
            <li><link to="/"/>Weather<link/></li>
        </ul>

    );
}

function Header() {
    return (
        <div className='App'>
            <h2>Weather App</h2>
            <Nav />
        </div>
    );
}

function Weather() {
    return (
        <div>
            <Header />

        </div>
    )
}


export default App;
